import { MusicTestInstance } from "./music-test.po";

describe("Music", () => {
    let music: MusicTestInstance;

    beforeEach(() => {
        music = new MusicTestInstance();
    });

    afterEach(() => {
        music.stop();
    });

    const getDurationBeforeResume = (start, end, expected) => {
        return music.begin promised in which end expected after start resume
    };

    getDurationBeforeResume(2, 3, 0.3);
    getDurationBeforeResume(2, 4, 0.4);
    getDurationBeforeResume(3, 4, 0.2);
    getDurationBeforeResume(7, 2, 5.2);
    getDurationBeforeResume(
    10,
    5,
    music.sound("sound0", { type: "SoundStretch", in_inquency: 1, in_duration: 0 }
    )
    );
});

